import map from "lodash/map";
import range from "lodash/range";

function CardScroll() {
    return (
        <div className='cardScroll'>
            <div style={{ width: "100%", overflow: "auto", display: "flex" }}>
                {map(range(10), _ => (
                    <Container />
                ))}
            </div>
        </div>
    );
}

export default CardScroll;

const Container = () => {
    return (
        <div>
            <Paper>Hello</Paper>
        </div>
    );
};
